sap.ui.define(["sap/ui/model/json/JSONModel", "sap/ui/Device"], function(e, t) {
	"use strict";
	return {
		createDeviceModel: function() {
			var r = new e(t);
			r.setDefaultBindingMode("OneWay");
			return r
		},
		getUserLog: function() {
			var t = new e;
			t.loadData("/services/userapi/currentUser");
			t.attachRequestCompleted(function e(t) {
				if (t.getParameter("success")) {
					this.setData({
						json: this.getJSON(),
						status: "Success"
					}, true);
					console.log("user-services", this.getJSON())
				} else {
					var r = t.getParameter("errorObject").textStatus;
					if (r) this.setData("status", r);
					else this.setData("status", "Unknown error retrieving user info")
				}
			});
			return t
		},
		createDetailModel: function() {
			var t = new e({});
			return t
		},
		createActivityModel: function() {
			var t = new e({});
			return t
		},
		createDateModel: function() {
			var t = new e({});
			return t
		},
		createUser2Model: function() {
			var t = new e({});
			return t
		},
		createListModel: function() {
			var t = new e({
				TipoActividad: [{
					text: "Llamada"
				}, {
					text: "Visita"
				}, {
					text: "Whatsapp"
				}],
				Estado: [{
					text: "Activa"
				}, {
					text: "En Proceso"
				}, {
					text: "Cerrada"
				}]
			});
			return t
		}
	}
});